function App() {


  return (
    <div className="App">
<BrowserRouter>
    <Routes>
      <Route path="/" element={<App />}>
        <Route path="movie" element={<Movie />}>
        </Route>
      </Route>
    </Routes>
  </BrowserRouter>


    </div>
  );
}

export default App;
